description:
Register MediatR with SimpleInjector

TargetFrameworks:
- netstandard1.3;
- netstandard2.0;
- net461

Encapsula a conexão e chamada aos métodos de um serviço SignalR.
Ex.: SingletonSignalRConnection _instance => SingletonSignalRConnection.GetInstance("http://localhost:8082/signalr", "SeuHub");

1- "Executando um método no server SignalR"
Task<DateTime> dateTime = _instance.Invoke<DateTime>("GetDateTime");

2- Registrando-se para um evento
_instance.On<string>("listenDateTime", d => Console.WriteLine(d));

